svg.script:
function ShowHotSpot(evt,hotspotid)
{
	var svgDocument = evt.target.ownerDocument;
	var strId = "hotspot."+hotspotid;
	var strId2 = strId + " partListFillElements";
	var strId3 = strId + " partListFillRegionElements";
	var hotspotElements = svgDocument.getElementsByClassName(strId);
	var hotspotFillElements = svgDocument.getElementsByClassName(strId2);
	var hotspotFillRegionElements = svgDocument.getElementsByClassName(strId3);
	if(hotspotElements) {
		for(let i = 0; i < hotspotElements.length; i++) {
			hotspotElements[i].setAttribute("stroke","#41A2DA");
			hotspotElements[i].setAttribute("stroke-width","0.3527");
		}
	}
	if(hotspotFillElements) {
		for(let i = 0; i < hotspotFillElements.length; i++) {
			hotspotFillElements[i].setAttribute("fill","#41A2DA");
			hotspotFillElements[i].setAttribute("fill-opacity",".5");
			hotspotFillElements[i].setAttribute("stroke","#000000");
			hotspotFillElements[i].setAttribute("stroke-width","0.3527");
		}
	}
	if(hotspotFillRegionElements) {
		for(let i = 0; i < hotspotFillRegionElements.length; i++) {
			hotspotFillRegionElements[i].setAttribute("fill-opacity",".5");
		}
	}
}
function HideHotSpot(evt,hotspotid)
{
	var svgDocument = evt.target.ownerDocument;
	var strId = "hotspot."+hotspotid;
	var strId2 = strId + " partListFillElements";
	var strId3 = strId + " partListFillRegionElements";
	var hotspotElements = svgDocument.getElementsByClassName(strId);
	var hotspotFillElements = svgDocument.getElementsByClassName(strId2);
	var hotspotFillRegionElements = svgDocument.getElementsByClassName(strId3);
	if(hotspotElements) {
		for(let i = 0; i < hotspotElements.length; i++) {
			hotspotElements[i].setAttribute("stroke","#000000");
			hotspotElements[i].setAttribute("stroke-width","0");
		}
	}
	if(hotspotFillElements) {
		for(let i = 0; i < hotspotFillElements.length; i++) {
			hotspotFillElements[i].setAttribute("fill-opacity","0");
		}
	}
	if(hotspotFillRegionElements) {
		for(let i = 0; i < hotspotFillRegionElements.length; i++) {
			hotspotFillRegionElements[i].setAttribute("fill-opacity","0");
		}
	}
}
